import React, { Component } from "react";
import {  } from './Dashboard.css';

import { NavLink } from "react-router-dom";
export default class Dashboard extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-3">sasa</div>
                    <div className=" paper col-9">
                        <NavLink to="/user/quiz" className="nav-link px-3">
                            <h4 className="text-dark text-center mt-5 mx-auto py-5 bg-light">
                                Please Login to Start the quiz
                            </h4>
                        </NavLink>
                    </div>
                </div>
            </div>
        );
    }
}
